class Integer:
    def __init__(self, value):
        self.value = value

    @staticmethod
    def get_number(value):
        number = roman[value]
        return number

    @classmethod
    def from_float(cls, value):
        if type(value) != float:
            return f'value is not a float'
        value = floor(value)
        return cls(value)

    @classmethod
    def from_roman(cls, value):
        number = cls.get_number(value)
        return cls(number)

    @classmethod
    def from_string(cls, value):
        if not type(value) == str:
            return f'wrong type'
        value = int(value)
        return cls(value)

    def add(self, integer):
        if not isinstance(integer, Integer):
            return f'number should be an Integer instance'
        result = self.value + integer.value
        return result
